function extractWordPair(inputStr) {
  return inputStr.split('\n')
      .map(line => line.trim())
      .filter(line => line)
      .map(line => {
          const [start, end, A, B] = line.split(' '); // Split to extract words and benchmarks
          return {
              start,
              end,
              score: {
                  A: parseInt(A, 10),
                  B: parseInt(B, 10)
              }
          };
      });
}


// Function to update the best score in localStorage
function updateBestScore(pairKey, score) {
    if (score > bestScores[pairKey]) {
        bestScores[pairKey] = score;
        localStorage.setItem(pairKey, JSON.stringify(score));
    }
}


